import React from "react";

const App = () => {
    const title = "blog post";
    const body = "This is blog's body";
    const comments = [
        { id: 1, text: "Comment 1" },
        { id: 1, text: "Comment 1" },
        { id: 1, text: "Comment 1" },
    ];

    return (
        <>
            <h1>{title}</h1>
            <p>This is the body of a paragraph</p>

            <div className="comments">
                <h2>Comments ({comments.length})</h2>
                <ul>
                    {comments.map((comment, index) => (
                        <li key={index}>{comment.text}</li>
                    ))}
                </ul>
            </div>
        </>
    );
};

export default App;
